import React from 'react';
import AddIcon from '@material-ui/icons/Add';
import { Link, NavLink } from 'react-router-dom';
import logoname from "../Images/logoname.png";
import "../index.css";
const Navbar = () => {
    return (
        
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <img src={logoname} alt="logo" className="logo_size"/>
            <Link className="navbar-brand" href="/"></Link>
            <button
        className="navbar-toggler"
        type="button"
        data-toggle="collapse"
        data-target="#navbarNavDropdown"
        aria-controls="navbarNavDropdown"
        aria-expanded="false"
        aria-label="Toggle navigation"
      ></button>
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="#navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse" id="navbarNavDropdown">
                <ul className="navbar-nav mr-auto ms-auto">
                    <li className="nav-item ">
                        <NavLink className="nav-link" exact to="/">Home </NavLink>
                    </li>
                    <li className="nav-item">
                        <NavLink className="nav-link" exact to="/Contact">Contact</NavLink>
                    </li>
                </ul>
                <NavLink className="btn btn-primary  my-2 my-sm-0" style={{ display: "flex", justifyContent: "center", alignItems: "center" }} exact to="/addUser" type="submit">{<AddIcon />} Add User</NavLink>
            </div>
        </nav>

    );
};

export default Navbar;
